259344411	464841811	47836635	364846007	115997801	10341110	1642094893	urn:DMS:Document:Universal:935586658	{806442125}	{1118804000,977887528}	\N	Александровка	2016-03-01	1	\N	80000.00	Donec ac finibus eros, ac vehicula eros. Sed vel rhoncus nunc. Nulla rhoncus semper orci sit amet eleifend. In ac felis at tellus vehicula varius. Suspendisse potenti. Maecenas quis nisi id nulla semper posuere eu at justo. Aliquam rutrum cursus finibus. Nulla at risus nec tellus iaculis tristique. Aenean sapien mi, consectetur ac elit nec, fermentum ullamcorper ex. Donec ornare aliquam vestibulum. Fusce faucibus eu erat ut pretium. Vivamus dui velit, aliquam sed feugiat ut, pretium in mauris.	{/original/urn-Document-Contract-LC-259344411/12729161_10208934761833456_2560875028545472853_n-5657554.jpg,/original/urn-Document-Contract-LC-259344411/10994069_10205784682076770_3965495420606387376_n-4408816.jpg}	<p><strong>Товариство з обмеженою відповідальністю «ХФК «Біокон»</strong>, (яке є платником податку на прибуток підприємств на загальних умовах, відповідно до Податкового Кодексу України), у подальшому <strong>Виконавець</strong>, в особі директора  Павлової Віри Валеріївни, яка діє на підставі Статуту, з однієї Сторони , </p>\n<p>та  _________________________________________________________________________ «_________________________» у подальшому <strong>Замовник</strong>, в особі Директора ____________________________________________________________, що діє на підставі Статуту, з другої сторони, уклали даний Договір про наступне:</p>	<ol><li><strong>Виконавець </strong>надає <strong>Замовнику</strong> послуги на території логістичного комплексу розташованого за адресою: Київська область, Бориспільський район, с. Велика Олександрівка, вул. Бориспільська, 9 для огляду вантажу, стоянки автомобілів, при необхідності розвантаження, навантажування або перенавантажування вантажу та наданні інших послуг, що передбаченні Додатком №1, що є невід’ємною частиною цього договору. </li>\n</ol>	<ol><li>\n<p>Сплата послуг проводиться <strong>Замовником</strong> на підставі виставлених рахунків від <strong>Виконавця </strong>та підписання Сторонами Акту наданих послуг. Оплата послуг наданих <strong>Виконавцем</strong> здійснюється - по факту наданих послуг за безготівковим розрахунком, шляхом переказу коштів на поточний рахунок <strong>Виконавця</strong> - не пізніше 5 (п’яти) банківських днів з моменту отримання Рахунку <strong>Замовником</strong>. Датою оплати вважається дата надходження коштів на поточний рахунок <strong>Виконавця</strong>.</p>\n</li>\n<li>\n<p>Загальна вартість послуг логістичного комплексу, автостоянки визначається з урахуванням розцінок визначених у Додатку №1 до цього Договору.  </p>\n</li>\n<li>\n<p>Факт надання послуг підтверджується Актом прийому-передачі наданих послуг, що оформлюється у двох екземплярах, по одному для кожної сторони, та підписується повноважними представниками сторін ї скріплюється печатками сторін протягом 2-х робочих днів з моменту отримання Рахунку <strong>Замовником</strong>. Підписання Акту прийому-передачі наданих послуг <strong>Замовником</strong> є підтвердженням відсутності претензій щодо наданих послуг зі сторони <strong>Виконавця</strong>.</p>\n</li>\n<li>\n<p>У випадку, якщо сума, перерахована на адресу <strong>Виконавця</strong>, перевищує фактичну вартість наданих послуг, надлишково перераховані грошові кошти перераховуються на розрахунковий рахунок <strong>Замовника</strong> після письмового повідомлення <strong>Замовника</strong>.</p>\n</li>\n</ol>	<ol><li>Сторони докладатимуть всіх зусиль для вирішення усіх спорів, які можуть виникати між ними за цим Договором або у зв’язку з ним шляхом дружніх переговорів. Будь-яка Сторона може розпочати переговори після надання письмового повідомлення іншій Стороні про свій намір розпочати такі переговори.</li>\n<li>У випадках, не передбачених даним Договором, Сторони керуються чинним законодавством України.</li>\n<li> Сторони визначають, що всі претензії за даним Договором повинні бути розглянуті Сторонами протягом 30 (тридцяти) днів з моменту отримання претензії.</li>\n<li>В разі не врегулювання спорів шляхом переговорів, вони підлягають розгляду в Господарському суді за місцезнаходженням відповідача із застосуванням норм матеріального права України. </li>\n</ol>	<ol><li>Даний Договір набирає чинності з моменту підписання його Сторонами та діє до «31» грудня 201_р.</li>\n<li>Договір може бути розірваний кожною із Сторін достроково з попередженням другої Сторони за один місяць.</li>\n<li>Після закінчення терміну дії Договору, якщо Сторони продовжують виконувати його умови, Договір вважається поновленим на невизначений термін, але кожна із сторін має право припинити його дію, попередивши про це другу сторону за один місяць.</li>\n<li><strong>Виконавець</strong> має статус платника податку на прибуток підприємств на загальних <br />підставах.</li>\n<li><strong>Замовник </strong>має статус платника податку на прибуток підприємств на _______________. </li>\n<li>Даний Договір складений у двох примірниках : по одному примірнику для кожної Сторони.</li>\n<li>У випадках, не передбачених даним Договором, сторони керуються нормами <br />чинного законодавства.</li>\n<li>Після підписання цього Договору усі попередні переговори за ним, <br />листування, попередні угоди та протоколи про наміри з питань, що так чи інакше <br />стосуються цього Договору, втрачають юридичну силу.</li>\n</ol>	\N	Configuring	UPN:DMS:Contracts:Contract:5403191	\N	{}	\N	urn:Actor:User:System:1	\N	t	f	f	f	\N	\N	1456669856	1456669856	{urn:Management:Post:Individual:1118804000,urn:Management:Post:Individual:1816416714}	\N	\N	<ol><li><strong>Виконавець</strong> зобов’язується:\n<ul><li>надавати послуги логістичного комплексу, автостоянки при виконанні <strong>Замовником</strong> своїх зобов’язань згідно з<strong>  </strong>п.2.1 даного Договору;</li>\n<li>надавати вчасно та якісно послуги, передбачені п.1.1 даного Договору на підставі письмової або усної заявки від <strong>Замовника</strong> при виконанні умов п.2.1 даного Договору <strong>Замовником</strong>;</li>\n<li>повертати надлишково перераховані грошові кошти <strong>Замовнику</strong>, як це передбачено п.2.4 даного Договору.</li>\n<li>при виникненні обставин, що перешкоджають належному виконанню своїх <br />зобов’язань, згідно з цим Договором, терміново повідомити про це <strong>Замовника</strong>.</li>\n<li>Складати та передавати <strong>Замовнику</strong> акти про надання послуг</li>\n<li>зберігати комерційну таємницю, яка міститься в документах <strong>Замовника.</strong></li>\n</ul></li>\n<li><strong>Замовник </strong>зобов'язується:\n<ul><li>розрахуватись за послуги, надані <strong>Виконавцем </strong>у порядку,  визначеному п.2.1 даного Договору.</li>\n<li>приймати від <strong>Виконавця </strong>послуги, що надаються згідно з цим Договором.</li>\n<li>після контролю за достовірністю актів про надання послуг <strong>Виконавцем</strong>, <br />підписувати ці акти в 5 денний термін з дати одержання.</li>\n</ul></li>\n</ol>	\N	\N	\N
\.


