559387216	20354926	464841811	1117149226	115997801	10341110	1642094893	urn:DMS:Document:Universal:1070090924	{1718779636}	{1118804000,977887528,1816416714}	\N	Александровка	2016-03-01	1	\N	70000.00	Donec ac finibus eros, ac vehicula eros. Sed vel rhoncus nunc. Nulla rhoncus semper orci sit amet eleifend. In ac felis at tellus vehicula varius. Suspendisse potenti. Maecenas quis nisi id nulla semper posuere eu at justo. Aliquam rutrum cursus finibus. Nulla at risus nec tellus iaculis tristique. Aenean sapien mi, consectetur ac elit nec, fermentum ullamcorper ex. Donec ornare aliquam vestibulum. Fusce faucibus eu erat ut pretium. Vivamus dui velit, aliquam sed feugiat ut, pretium in mauris.	{/original/urn-Document-Contract-LWP-559387216/12794478_574379002724557_2475743878234406571_n-5520808.jpg}	<p><strong>Общество с ограниченной ответственностью «ХФК «Биокон»</strong>, созданное и действующее по законам Украины, в лице Директора Павловой Веры Валерьевны, действующей на основании Устава, далее <strong>"Арендодатель"</strong>, с одной стороны,</p>\n<p>и</p>\n<p><strong>Общество с ограниченной ответственностью «___________»</strong>, созданное и действующее по законам Украины, в лице Директора ___________________, действующего на основании Устава (в дальнейшем именуемое «<strong>Арендатор</strong>») с другой стороны,</p>\n<p>Поскольку Арендатор – ищет складские помещения, для использования их в качестве аптечного склада,</p>\n<p>Поскольку Арендодатель имеет складские помещения в своем распоряжении, которые пригодны для использования в качестве аптечного склада, </p>\n<p>На основании изложенного выше и руководствуясь законодательством Украины (главой 58 "Наем (Аренда)" Гражданского Кодекса Украины) без применения положений Закона Украины "Об аренде государственного и коммунального имущества", Стороны заключили настоящий договор (далее – <strong>Договор</strong>) о нижеследующем:</p>\n<p> </p>	<p>Для целей этого Договора следующие употребленные в нем термины следует понимать как указано ниже:</p>\n<p><strong>Арендатор</strong> – Общество с ограниченной ответственностью <strong>«</strong>________<strong>»</strong>;</p>\n<p><strong>Арендодатель</strong> – Общество с ограниченной ответственностью «ХФК «Биокон»;</p>\n<p><strong>Здание</strong> – здание по адресу: Украина, Киевская обл., Бориспольский р-н, с. Большая Александровка, ул. Бориспольская, 9, в котором находится объект Аренды.</p>\n<p><strong>Складской комплекс </strong>– здания и сооружения, в том числе Здание, в котором находится объект Аренды, расположенные на земельном участке по адресу: Украина, Киевская обл., Бориспольский р-н, с. Большая Александровка, ул. Бориспольская, 9, огражденные по периметру.</p>\n<p><strong>Арендованы(о)е помещения(е) и/или Помещения(е)</strong> – складские и офисные помещения площадью _____________ (______________ и _______) кв. м (___________ кв. м. – складские помещения, _______ кв. м. – офисные помещения, _______ кв. м. – холодильная камера), которые составляют часть Здания находящегося по адресу: Киевская обл., Бориспольский р-н, с. Большая Александровка, ул. Бориспольская, 9. Описание арендованных помещений приведено в <strong>Приложении № 1</strong> (план помещений), которое является неотъемлемой частью Договора;</p>\n<p><strong>Складское оборудование</strong> – стеллажная структура общей паллетоемкостью ___________ паллето-мест, установленная в Помещении.</p>\n<p><strong>Срок Аренды</strong> – определенный настоящим Договором временной отрезок, на протяжении которого Арендатор имеет право пользоваться Помещениями и Складским оборудованием и после завершения которого Помещения и Складское оборудование должны быть возвращены Арендодателю.</p>\n<p><strong>Обслуживание сигнализации</strong> – обеспечение ее бесперебойного функционирования согласно эксплуатационной документации путем проведения профилактических осмотров, выявления повреждений, которые могут привести к выходу ее из эксплуатации, а также устранения неисправностей.</p>\n<p><strong>Пост охраны </strong>– место несения службы сотрудника охраны (охранника), которое расположено на территории Складского комплекса.</p>\n<p><strong>Текущий ремонт </strong>– все работы, за исключением замены несущих конструкций, капитального ремонта (полной замены) внутренних коммуникаций: сантехнических,  водоснабжающих, канализационных и т.д.;</p>\n<p><strong>Коммунальные и эксплуатационные услуги </strong>– обеспечение Арендованных помещений отоплением,  горячей и холодной водой, вентиляцией и кондиционированием воздуха, а также обслуживание канализационных сетей, техническое обслуживание системы газоснабжения системы вентиляции и кондиционирования, сети электрообеспечения, системы подачи тепла, вывоз мусора, оплата работы персонала технической службы Арендодателя, уборка и благоустройство территории Складского комплекса.</p>\n<p><strong>Сторона</strong> – Общество с ограниченной ответственностью ХФК "Биокон" или Общество с ограниченной ответственностью "______________", именуемые отдельно.</p>\n<p><strong>Стороны</strong> – Общество с ограниченной ответственностью ХФК "Биокон" и Общество с ограниченной ответственностью " ______________", которые именуются вместе.</p>\n<p><strong>Акт приема-передачи Помещения и складского оборудования</strong> – документ, на основании которого осуществляется передача Арендатору Арендованных помещений и Складского оборудования. Дата подписания Акта указывает на дату начала срока аренды.</p>\n<p><strong>Акт возврата-передачи Помещения</strong> <strong>и складского оборудования</strong> – документ, на основании которого осуществляется возврат Арендодателю  Арендованных помещений и Складского оборудования. Дата подписания Акта указывает на время окончания Срока аренды.</p>\n<p><strong>Свидетельство о праве собственности на недвижимое</strong> имущество – документ, подтверждающий право собственности Арендодателя на передаваемые в аренду Помещения.</p>	<ol><li>Арендодатель передает, а Арендатор принимает в срочное платное пользование (аренду)  нежилые Помещения и Складское оборудование на срок 35 (тридцать пять) календарных месяцев от даты подписания Сторонами Акта приема-передачи Помещения и складского оборудования (в дальнейшем именуемое как <strong>"срок аренды"</strong>).</li>\n<li>Помещения  принадлежат Арендодателю на основании Свидетельства о праве собственности на недвижимое имущество серии CАК 136135 от 01.07.2013 г.</li>\n<li>Стороны согласились, что на момент подписания настоящего Договора стоимость Помещения, указанного в п. 1.1 настоящего Договора, нежилого Помещения и складского оборудования (восстановительная стоимость с учетом индексации), составляет __________________________. <br />Амортизационные начисления, проводимые на Помещение и Складское оборудование, остаются в распоряжении Арендодателя.</li>\n</ol>	<ol><li>Арендодатель передает указанное Помещение Арендатору для использования последним под аптечный склад для хранения готовых сертифицированных в Украине лекарственных средств. </li>\n<li>Передача Помещения и Складского оборудования в аренду не влечет за собой передачу права собственности на это Помещение и Складское оборудование. Настоящий Договор не предусматривает выкупа Помещений и Складского оборудования.</li>\n<li>Помещение и Складское оборудование считаются переданными Арендодателем Арендатору с момента подписания сторонами Акта приема-передачи Помещения и Складского оборудования, который Стороны подписывают в момент передачи Помещения и Складского оборудования, но не позднее, чем ___ календарных дней с момента подписания данного Договора.</li>\n<li>В свою очередь, Помещение и Складское оборудование считаются возвращенными Арендатором Арендодателю с момента подписания Акта возврата-передачи Помещения и Складского оборудования.</li>\n<li>Арендодатель обязан обеспечивать Арендатору свободный доступ (включая доступ перевозочных средств) в Здание и Арендованные помещения до начала срока аренды в целях проведения необходимых замеров, подготовки рабочих площадей для установки мебели и другого оборудования в Помещениях, а так же передать документы необходимые для получения Арендатором лицензий на импорт и  оптовую торговлю лекарственными средствами.</li>\n</ol>	<p>Арендатор обязан:</p>\n<ol><li>Использовать арендованное Помещение в соответствии с условиями этого Договора.</li>\n<li>Оплачивать арендную плату, указанную в п.3 Договора, в размерах и сроки, предусмотренные настоящим Договором.</li>\n<li>Не хранить и не использовать в арендованных Помещениях взрывчатые, радиоактивные вещества и материалы, другие предметы на хранение которых не получено должного разрешения, сертификата, свидетельства.</li>\n<li>Своевременно информировать Арендодателя о выявленных неисправностях конструктивных элементов Здания в Арендованных помещениях.</li>\n<li>Обеспечивать доступ в Арендуемые помещения работников Арендодателя и коммунальных служб для необходимого осмотра и ремонта сетей водопровода, канализации, систем отопления, вентиляции и кондиционирования, других коммуникаций в рабочее время, предварительно согласованное с Арендатором за 1 (один) рабочий день, а в случае аварийной ситуации – немедленно.</li>\n<li>Пользоваться Арендованным помещением в соответствии с действующим законодательством Украины и условиями этого Договора.</li>\n<li>Арендатор обязан вернуть Арендованное помещение и Складское оборудование в том же состоянии, в котором оно было принято по Акту приема-передачи Помещения и Складского оборудования, но с учетом естественного износа.</li>\n<li>Не включая случаев естественного износа, в случае причинения умышленного или неумышленного ущерба Арендованному помещению и Складскому оборудованию Арендатором, если его вина в таком причинении будет надлежащим образом доказана путем составления Сторонами акта о повреждении Помещения, Арендатор возмещает Арендодателю все прямые расходы, разумно понесенные на восстановление Арендуемого помещения и Складского оборудования в предыдущее состояние. Во избежание недоразумений, Арендатор не несет ответственности в какой- бы то ни было форме за любые скрытые или собственные дефекты Здания, материалов и/или конструкций Арендованных помещений, Складского оборудования, а также работ, проводившихся в них и с ними Арендодателем.</li>\n</ol>	<ol><li>Сотрудники, клиенты, какие-либо иные посетители Арендатора имеют доступ в Здание и арендованные Помещения в порядке, установленном «Правилами внутреннего распорядка на территории логистического комплекса «Биокон»», которые  являются неотъемлемой частью настоящего Договора. </li>\n<li>Пользоваться местами общего пользования Здания, в котором находятся Арендованные помещения, а именно входами, лестницами, коридорами, лифтами, туалетами и т.д., а так же местами парковки автотранспорта без дополнительной оплаты.</li>\n<li>Арендатор имеет право по согласованию с Арендодателем и за свой счет проводить текущий ремонт Арендованных помещений и Складского оборудования в случае, если такие работы не будут произведены Арендодателем в соответствии с п.6.4. Договора.</li>\n</ol>	<p>Арендодатель обязан:</p>\n<ol><li>Передать Арендатору в аренду Помещение и Складское оборудование в соответствии с этим Договором и поддерживать его в состоянии, которое обеспечивает его использование согласно целевому назначению (п.2.1 Договора).</li>\n<li>Своевременно и в полном объеме уплачивать земельный и другие налоги и сборы, коммунальные платежи в порядке, который установлен действующим законодательством Украины.</li>\n<li>В случае необходимости получить все разрешения, которые необходимы (будут необходимы) для надлежащего исполнения Договора.</li>\n<li>За свой счет поддерживать в рабочем состоянии и ремонтировать структурные элементы Арендованных помещений, в том числе двери, окна, водопроводно-канализационные системы, системы вентиляции и кондиционирования, системы пожаротушения и пожарной сигнализации, освещение, электрооборудование и другие средства коммунального обслуживания, выполнять капитальный и текущий ремонты  Арендованных помещений. В случае, если возникает необходимость в текущем ремонте и Арендодатель не выполнит его в течение двадцати (20) рабочих дней после письменного уведомления от Арендатора, последний имеет право, после согласования с Арендодателем, выполнить такой ремонт и вычесть его стоимость из ежемесячного арендного платежа. Более того, Арендодатель в разумный срок с момента получения уведомления за свой счет обязуется исправлять любые скрытые или собственные дефекты Здания, материалов и/или конструкции Арендованных помещений, а также работ, проводившихся в них Арендодателем.<br />Все структурные элементы Арендованных помещений и оборудование, указанные в п.6.4. данного Договора, должно быть установлено за счет Арендодателя и быть в рабочем состоянии на момент подписания Акта приема-передачи Помещения и Складского оборудования.</li>\n<li>Обеспечить Арендованные помещения электроэнергией 24 часа в сутки, 7 дней в неделю. Обеспечить резервное электропитание.</li>\n<li>Обеспечить температуру внутри Арендованных помещений не ниже 15ºС и не выше 25ºС, а температуру горячей воды согласно установленных нормативов. </li>\n<li>Обеспечивать обслуживание пожарной и охранной сигнализации и содержание круглосуточных постов охраны на территории Складского комплекса, принимать меры по предотвращению хищений имущества Арендатора, которое находится в Арендуемых помещениях, его повреждений и уничтожения, а также несанкционированному проникновению посторонних лиц. </li>\n<li>В случае повреждения Арендованного помещения не по вине Арендатора, за свой счет принять необходимые меры по сохранности имущества, принадлежащего  Арендатору, которое на момент повреждения находилось в Арендуемом помещении. При этом сохранность такого имущества должна быть обеспечена в условиях, равнозначных условиям Арендуемого помещения, включая, но не ограничиваясь, условиями п.6.6. Договора.</li>\n<li>В случае, если Арендованное помещение будет разрушено/уничтожено по доказанной вине Арендодателя, Арендодатель обязан возместить Арендатору все связанные с такой потерей убытки  в полном объеме, в частности путем уменьшения арендной платы.</li>\n<li>В случае причинения Арендодателем умышленного или неумышленного ущерба имуществу Арендатора, которое находится в Арендованном помещении, если его вина в таком причинении будет надлежащим образом доказана или признана путем составления Сторонами Акта о повреждении имущества Арендатора, Арендодатель возмещает Арендатору все прямые расходы, разумно понесенные на ремонт и/или покупку нового имущества для возврата в предыдущее состояние, а так же убытки. Для  избежания недоразумений, Арендодатель не несет ответственности в какой бы то ни было форме за любые скрытые или собственные дефекты имущества Арендатора.<br />В случае отказа Арендодателя от подписания Акта о повреждении имущества Арендатора, данный акт составляется и подписывается Арендатором самостоятельно и направляется Арендодателю, что является основанием для досрочного расторжения Договора в одностороннем порядке по инициативе Арендатора. В таком случае, Договор считается расторгнутым с момента получения Арендодателем письменного уведомления Арендатора о расторжении. </li>\n</ol>	<ol><li>Своевременно получать арендную плату, предусмотренную в Разделе 3 настоящего Договора. </li>\n<li>Проверять Помещение, а также порядок его использования Арендатором в соответствии с условиями настоящего Договора. </li>\n<li>Пресекать использование Помещения, которое противоречит целевому предназначению Помещения, определенному в п. 2.1. настоящего Договора. </li>\n</ol>	<ol><li>Арендная плата начисляется с момента подписания Акта приема-передачи помещения и Складского оборудования с начала Срока аренды и до окончания Срока аренды, определенного в п.1.1. настоящего договора. Арендная плата вносится на основании ежемесячных счетов Арендодателя, которые выставляются в начале месяца, следующего за оплачиваемым. Арендная плата уплачивается не позднее 7 банковских дней после даты получения счета Арендатором. Оплата за первый месяц и за последний месяц аренды вносится на условиях 100% предоплаты.</li>\n<li>В соответствии с условиями настоящего Договора общая арендная плата в месяц будет составлять <strong>_______ </strong> (____________________) в том числе НДС 20%, что эквивалентно <strong>____________</strong> долларов США по официальному курсу НБУ, в том числе:\n<ul><li>ставка аренды 1 кв. м. складских помещений - _________ грн. (в т. ч. 20% НДС), что эквивалентно ____ доллара США по официальному курсу НБУ, что при расчете арендной платы за пользование  ________ кв. м. складских помещений составляет - <strong>__________</strong> (в т. ч. 20% НДС), что эквивалентно <strong>_________</strong> доллара США по официальному курсу НБУ;</li>\n<li>ставка аренды 1 кв. м. холодильной камеры – ______ грн. (в т. ч. 20% НДС), что эквивалентно ________ доллара США по официальному курсу НБУ, что при расчете арендной платы за пользование  _______ кв. м. холодильной камеры составляет – <strong>__________</strong> (в т. ч. 20% НДС), что эквивалентно <strong>_______</strong> доллара США по официальному курсу НБУ;</li>\n<li>ставка аренды 1 кв. м. офисных помещений – ______ грн. (в т. ч. 20% НДС), что эквивалентно ________ доллара США по официальному курсу НБУ, что при расчете арендной платы за пользование  ________ кв. м. офисных помещений составляет – <strong>________ грн.</strong> (в т. ч. 20% НДС), что эквивалентно <strong>_______</strong> доллара США по официальному курсу НБУ.<br />Стороны соглашаются, что официальный курс обмена гривны к доллару США установленный НБУ на дату заключения настоящего Договора (на ______2015 до 14:00) и применённый Сторонами в тексте данного Договора составляет ________  грн. за 1 доллар США.</li>\n</ul></li>\n<li>Расходы, связанные с содержанием и пользованием Помещением: \n<ol><li>В размер арендной платы не включается стоимость коммунальных и эксплуатационных услуг, которые рассчитываются по факту потребления всего Складского комплекса в пересчете на 1 кв.м. (без дополнительной прибыли Арендодателя) и компенсируются отдельно на основании счетов, которые оформляются и оплачиваются одновременно со счетами аренды в соответствии с положениями п. 3.1. Договора. Коммунальные и эксплуатационных расходы компенсируются Арендатором в гривнах при наличии расчета суммы коммунальных и эксплуатационных платежей, с последующим предоставлением копий документов коммунальных и эксплуатационных служб, подтверждающих такие расходы. <br />Арендатор компенсирует Арендодателю _____ % (_______________) от стоимости коммунальных и эксплуатационных услуг, которые рассчитываются по факту потребления всего Складского комплекса за соответствующий календарный месяц.<br />Потребляемая Арендатором электроэнергия в Арендованных помещениях компенсируется в размере _______ % (___________) от  общего фактического потребления электроэнергии всем Складским комплексом за соответствующий календарный месяц.</li>\n<li>Услуги по обслуживанию охранной сигнализации и содержанию постов круглосуточной охраны на территории Складского комплекса включены в размер арендной платы.</li>\n</ol></li>\n<li>В случае, если на день выставления счета официальный курс гривны к доллару США, установленный НБУ, изменится в отношении к зафиксированному настоящим Договором курсу доллару (курс зафиксирован в п. 3.2. Договора) более чем на 5%, сумма месячной арендной платы за 1 кв. м. пересчитывается согласно курсу гривны к доллару США, установленному НБУ на день выставления счета по следующей формуле:<br />где: <br /><br />S          - откорректированная сумма месячной арендной платы за 1 м2;<br />S0         - сумма месячной арендной платы за 1 м2 согласно п. 3.2 Договора;<br />r           - обменный курс украинской гривны к доллару США, установленный НБУ на день  выставления счета.<br />r0         - обменный курс украинской гривны к доллару США, зафиксированный в п. 3.2. Договора. <br />Размер арендной платы может изменяться по согласованию Сторон.</li>\n<li>В случаях, предусмотренных п.6.9. настоящего Договора, а также в иных случаях, препятствующих надлежащему хранению и/или отгрузке продукции Арендатора или иному использованию Помещения Арендатором согласно настоящему Договору (в частности, необоснованное ограничение доступа Арендатора в Здание и Арендованные помещения; снижение объема получаемых энергоносителей и/или коммунальных услуг или полное прекращение их подачи, произошедшее по вине Арендодателя), арендная плата снижается пропорционально площади Помещения, непригодной для использования, и/или пропорционально сроку, в течение которого Помещение остается непригодным для использования, о чем Стороны составляют акт о непригодности Помещений для целевого использования. Данный акт является основанием для снижения арендной платы. <br />В случае отказа Арендодателя от подписания Акта о непригодности Помещений для целевого использования, данный акт составляется и подписывается Арендатором самостоятельно и направляется Арендодателю, что является основанием для досрочного расторжения Договора в одностороннем порядке по инициативе Арендатора. В таком случае, Договор считается расторгнутым с момента получения Арендодателем письменного уведомления Арендатора о расторжении. </li>\n</ol>	<ol><li>За неисполнение или ненадлежащее исполнение обязательств в соответствии с настоящим Договором Стороны несут ответственность, предусмотренную действующим законодательством Украины и условиями настоящего Договора, в том числе возмещают убытки, причиненные таким неисполнением или ненадлежащим исполнением обязательств в полном объеме.</li>\n<li>В случае, если Арендодатель не обеспечил необходимые условия хранения в соответствии с условиями пункта 6.6. настоящего Договора, и если, Арендатор,  как результат понес убытки, Арендодатель обязан компенсировать подтвержденные  убытки Арендатору. </li>\n<li>В случае нарушения Арендатором обязанностей, предусмотренных в Разделе3. Договора, а именно, просрочки оплаты арендной платы более чем на семь  календарных день, Арендатор уплачивает Арендодателю по его требованию пеню в размере двойной учетной ставки Национального Банка Украины, действующей на момент совершения нарушения от общей суммы задолженности, начиная с первого дня просрочки.</li>\n<li>Споры, которые возникают в связи с настоящим Договором, разрешаются дружественным путем по соглашению Сторон.</li>\n<li>Если согласие не будет достигнуто, спор передается на рассмотрение в Хозяйственный суд Украины в соответствии с правилами о подведомственности и подсудности споров, предусмотренными действующим законодательством Украины.</li>\n<li>Риск случайной гибели или повреждения Арендованного помещения и Складского оборудования несет Арендодатель.</li>\n<li>Этот Договор составлен в соответствии с законодательством Украины и на него распространяется действие соответствующего законодательства Украины, без отсылок к коллизионным нормам и без применения Закона Украины "Об аренде государственного и коммунального имущества".</li>\n<li>Стороны согласовали, что сроки исковой давности для взыскания пени и других штрафных санкций по данному Договору, а так же по всем другим положениям и спорам применяются сроки исковой давности установленные действующим законодательством Украины.</li>\n</ol>	<ol><li> Настоящий Договор вступает в силу с момента его подписания и действует на протяжении     35 месяцев с момента подписания Акта приема-передачи Помещения и Складского оборудования.</li>\n<li>Настоящий Договор будет оставаться в силе в части финансовых обязательств, даже по истечению Срока аренды, до момента исполнения Сторонами своих финансовых обязательств по Договору.</li>\n<li>Условия Договора сохраняют силу на протяжении всего срока действия Договора.</li>\n<li>Этот Договор может быть расторгнут:\n<ol><li>В одностороннем порядке Арендатором, в любое время, без объяснения причин при условии, что он письменно уведомляет Арендодателя за 90 календарных дней до такого расторжения, В таком случае, Договор считается расторгнутым с даты указанной в письменном уведомлении (или через 90 календарных дней) после даты получения Арендодателем письменного уведомления Арендатора о расторжении;</li>\n<li>По согласию Сторон;</li>\n<li>По решению суда;</li>\n<li>Односторонне, Арендодателем, в случае систематического неисполнения Арендатором своих обязанностей по оплате арендных платежей и/или в случае использования Арендатором Помещения в целях иных, чем указано в п.2.1. Договора Систематическим неисполнением считается задержка Арендатором платежей за три  месяца подряд. В таком случае, Договор считается расторгнутым с момента получения Арендатором письменного уведомления Арендодателя о расторжении. </li>\n</ol></li>\n<li>Если какое-нибудь положение этого Договора признается недействительным, это не влечет недействительности Договора в целом. В таком случае применяется норма, которая одновременно является действительной и наиболее соответствует смыслу и назначению положения, признанного недействительным в судебном порядке.</li>\n<li>Односторонний отказ от исполнения Договора не допускается, кроме случаев предусмотренных в Договоре.</li>\n<li>В случаи изменения владельца (Арендодателя) Арендованного помещения, в том числе, в рамках взыскания долгов по кредитным и обеспечительным договорам Арендодателя, данный Договор и все его положения сохраняют действие для нового владельца (Арендодателя).</li>\n</ol>	<ol><li>Положения этого Договора действуют и являются обязательными для любых правопреемников Арендодателя относительно Арендованного помещения, и любых новых собственников Арендованного помещения.</li>\n</ol>	<ol><li>Договор составлен на русском языке на ____ (____) страницах в ____ (____) экземплярах, по одному для каждой из Сторон, которые имеют равную юридическую силу. </li>\n<li>С момента подписания этого Договора, он имеет преимущество перед всеми    предыдущими переговорами и перепиской по этому поводу.</li>\n<li>Любые изменения и дополнения к этому Договору действительны лишь в том случае, если они сделаны в письменном виде на русском языке и подписаны уполномоченными представителями обеих Сторон.</li>\n<li>Все дополнения, упомянутые в этом Договоре, и все дополнительные соглашения, изменения и приложения, составленные в период исполнения этого Договора, являются его неотъемлемыми частями.</li>\n<li>Все уведомления по этому Договору имеют силу только в том случае, если они были    предоставлены другой Стороне в письменном виде через курьера, рекомендованным или ценным письмом с уведомлением о вручении.</li>\n<li>Приложения к Договору:<br />Приложение № 1 (поэтажный план Арендованных помещений)<br />Приложение № 2 «Правила внутреннего распорядка на территории логистического комплекса «Биокон»». </li>\n</ol>	\N	Configuring	UPN:DMS:Contracts:Contract:2610852	\N	{}	\N	urn:Actor:User:System:1	\N	t	f	f	f	\N	\N	1456669881	1456669881	{urn:Management:Post:Individual:1816416714,urn:Management:Post:Individual:1118804000}	\N	\N	\N	\N	\N
