344180567	2059004404	464841811	364846007	115997801	10341110	1642094893	undefined	{1677568049}	{1118804000,977887528}	\N	Александровка	2016-02-01	2	\N	60000.00	Donec ac finibus eros, ac vehicula eros. Sed vel rhoncus nunc. Nulla rhoncus semper orci sit amet eleifend. In ac felis at tellus vehicula varius. Suspendisse potenti. Maecenas quis nisi id nulla semper posuere eu at justo. Aliquam rutrum cursus finibus. Nulla at risus nec tellus iaculis tristique. Aenean sapien mi, consectetur ac elit nec, fermentum ullamcorper ex. Donec ornare aliquam vestibulum. Fusce faucibus eu erat ut pretium. Vivamus dui velit, aliquam sed feugiat ut, pretium in mauris.	{/original/urn-Document-Contract-MT-344180567/moda-3631245.jpg}	<p>__________________________, назване в подальшому Постачальник, в особі генерального директора____________________________, якій діє на підставі Статуту,  з однієї сторони, та</p>\n<p><strong>Товариство з обмеженою відповідальністю «ХФК «Біокон»,</strong> назване в подальшому Покупець, в особі директора Павлової Віри Валеріївни, яка  діє на підставі Статуту, з іншої сторони, а при спільному згадуванні – Сторони, уклали цей договір про наступне:</p>	<ol><li>Постачальник зобов’язується поставити Покупцю ____________________, (далі – Товар) у кількості, асортименті і по цінам згідно з Специфікацій, що є невід’ємними частинами цього договору, а Покупець зобов’язується приймати Товар і своєчасно проводити оплату на умовах цього договору.</li>\n<li>Право власності на Товар переходить до Покупця з моменту фактичного отримання Товару та прийому його по якості та кількості згідно з умовами цього договору.</li>\n<li>Загальна сума договору становить вартість всього Товару, який поставлено протягом дії договору.</li>\n</ol>	<ol><li>Якість Товару повинна відповідати діючим в Україні стандартам і підтверджуватися супроводжуючими Товар документами – сертифікатом якості виробника та іншими документами, встановленими чинним законодавством. Вказані документи надаються в повному обсязі і мають бути оформлені відповідно до вимог діючого законодавства України. Постачальник гарантує безпеку Товару, тобто відсутність будь-якого ризику для життя, здоров’я, майна споживачів та навколишнього природного середовища за загальних умов використання, зберігання, транспортування та утилізації Товару. Відповідальність за порушення цієї гарантії покладається на Постачальника.</li>\n<li>Упаковка повинна забезпечувати повне збереження Товару від усякого роду пошкоджень і псування при перевезенні його будь-якими видами транспорту з урахуванням перевантажень в дорозі, а також тривалого зберігання.</li>\n<li>Вартість тари та упаковки включається в ціну Товару та поверненню Постачальнику не підлягає.    </li>\n</ol>	<ol><li>Строк поставки Товару визначається у відповідній Специфікації.</li>\n<li>Товар постачається на умовах _________________________________  згідно з  Інкотермс - 2010. При цьому умови Інкотермс застосовуються тільки в тій частині, яка може бути застосована для  поставок на території України. Специфікацією можуть бути визначені інші умови поставки, які у такому випадку превалюють над умовами, що визначені п. 3.2. договору.</li>\n<li>Датою поставки (момент фактичного отримання) Товару є дата приймання Товару у місці поставки, що засвідчується підписом уповноваженої особи Покупця на накладній.</li>\n<li>Постачальник вважається таким, що виконав свої зобов’язання щодо поставки Товару, якщо він здійснив поставку Товару:\n<ul><li>в узгоджені з Покупцем строки та час;</li>\n<li>в асортименті та кількості, узгодженому у Специфікації;</li>\n<li>за цінами, узгодженими сторонами в Специфікації;</li>\n<li>з повним пакетом супровідної документації;</li>\n<li>у повній відповідності з чинним законодавством України та умовами цього договору.</li>\n</ul></li>\n</ol>	<ol><li>Прийом Товару за кількістю та якістю здійснюється сторонами відповідно до Інструкцій № П-6 від 15 червня 1965 р. та № П-7 від 25 квітня 1966 р., затверджених постановами Держарбітражу при Раді Міністрів СРСР.</li>\n<li>Товар вважається зданим Постачальником та прийнятим Покупцем:\n<ul><li>відносно кількості – відповідно до накладної, що підтверджується підписом представника Покупця на всіх примірниках накладної;</li>\n<li>відносно якості – згідно із сертифікатом якості виробника та іншими супровідними документами.</li>\n</ul></li>\n<li>Якщо Товар або його частина виявиться невідповідної якості та (або) не відповідає умовам договору, то він підлягає заміні Постачальником  протягом 10 днів з моменту складання відповідного акту та (або) надання документів, що підтверджують неналежну якість Товару. За бажанням Покупця Товар (або його частина), що виявилася невідповідної якості, може бути повернута за рахунок Постачальника без умов додаткової поставки.</li>\n<li>Покупець має право прийняти Товар без проведення перевірки його кількості та якості у разі, якщо упаковка Товару здійснена належним чином та не має явних дефектів. У цьому випадку перевірка кількості та якості Товару здійснюється після отримання Покупцем Товару. У разі виявлення недоліків, Покупець повинен викликати представника Постачальника для складання відповідного акту. Представник Постачальника повинен прибути до місця виявлення недоліків не пізніш як у 2 (двох) денний строк з моменту отримання повідомлення. У разі неявки представника, Покупець має право на складання одностороннього акту та на його підставі – зупинити виконання грошових зобов’язань стосовно отриманого за відповідною партією Товару до моменту його заміні та/або додаткової поставки.</li>\n<li>У випадку виявлення невідповідності фактичної кількості Товару, зазначеної в накладній, а також не комплектного, ушкодженого Товару, Постачальник протягом 3 (трьох) календарних днів від дати одержання відповідного повідомлення від Покупця, зобов’язаний допоставити Товар або замінити ушкоджений Товар на якісний. У випадку неможливості допоставки Товару Покупцеві, Постачальник зобов’язаний здійснити коригування розрахунків з урахуванням вартості недопоставленого Товару. У випадку неможливості заміни пошкодженого, некомплектного Товару, ПРОДАВЕЦЬ зобов’язаний прийняти пошкоджений, неякісний Товар та здійснити коригування розрахунків.</li>\n<li>Претензії по прихованому заводському браку можуть бути заявлені Покупцем на протязі всього терміну придатності Товару. Постачальник протягом 3 (трьох) календарних днів від дати отримання  відповідного повідомлення зобов’язаний замінити  бракований, неякісний Товар на якісний. У випадку не можливості заміни Постачальник зобов’язаний прийняти  бракований Товар та здійснити корегування розрахунку.</li>\n<li>Гарантійний строк (протягом якого Постачальник гарантує якість Товару) становить два роки з моменту передачі Товару Покупцю, якщо інший строк не встановлено супровідною  документацією до Товару.</li>\n</ol>	<ol><li>Покупець оплачує отриманий Товар за цінами, передбаченими у Специфікації, що є невід’ємною частиною цього договору.</li>\n<li>Ціни, вказані в Специфікації,включають вартість відвантаження,пакування, маркування Товару тощо.</li>\n<li>Умови оплати Товарувизначаються у відповідній Специфікації.</li>\n<li>Оплата товарів здійснюється шляхом перерахування суми вартості товарів на поточний рахунок Постачальника, що вказаний у цьому договорі. Про зміну реквізитів рахунків Постачальник повинен письмово попередити Покупця. У випадку неповідомлення Постачальник несе для себе ризик настання несприятливих наслідків пов'язаних з таким неповідомленням. </li>\n</ol>	<ol><li>Цей договір набирає чинності з моменту його підписання сторонами та діє до __________ р., але у будь-якому випадку до виконання сторонами своїх зобов’язань.</li>\n<li>У випадку, якщо жодна зі сторін за 30 днів до закінчення строку цього договору не повідомить іншу про припинення дії договору, він вважається пролонгованим на цих же умовах на наступний календарний рік. Ця умова може бути застосована неодноразово.</li>\n</ol>	<ol><li>За порушення умов даного договору сторони несуть відповідальність згідно з чинним законодавством України. За цим договором неустойка (штраф, пеня) стягується понад сум збитків.</li>\n<li>За порушення строку оплати Покупець сплачує пеню в розміру подвійної облікової ставки НБУ від суми простроченого грошового зобов’язання за кожний день прострочки.</li>\n<li>У разі порушення строку поставки Товару, Постачальник сплачує Покупцю за кожний день прострочення неустойку, яка нараховується у розмірі подвійної облікової ставки Національного банку України, яка діяла протягом терміну прострочення постачання від вартості недопоставленого Товару.</li>\n<li>У разі прострочення Постачальника поставки Товару більше ніж на 10 календарних днів Постачальник додатково сплачує штраф у розмірі 10% від загальної вартості Товару, поставка якого прострочена.</li>\n<li>У разі прострочення Постачальника з поставки Товару більше ніж на 20 календарних днів Покупець має право відмовитися від прийняття зобов’язань Постачальника за Договором. В такому випадку Постачальник протягом 10-ти календарних днів з моменту відмови Покупця від прийняття зобов’язання здійснює повернення отриманої суми передоплати.<br />Відмова Покупця від прийняття зобов’язання не звільняє Постачальника від сплати штрафних санкцій.<br />У випадку прострочення Постачальником повернення сум згідно пункту 7.5. Договору, Постачальник сплачує Покупцю штраф, який визначається в наступному порядку:<br />P= Sх Dx 0,1%, де:<br />Р – розмір штрафу;<br />S – сума передоплати, повернення якої прострочено Постачальником;<br />D – кількість днів прострочення.</li>\n<li>ПРОДАВЕЦЬ несе відповідальність:<br /><ul><li>за ненадання, прострочення надання ПОКУПЦЮ податкової накладної та/або розрахунку коригування кількісних та вартісних показників до неї;</li>\n<li>у випадку не проведення своєчасної реєстрації  податкової накладної  або розрахунку коригування кількісних і вартісних показників до податкової накладної в Єдиному  реєстрі податкових накладних;</li>\n<li>за ненадання продовж 5-ти днів з моменту зміни податкового статусу, в т.ч. статусу платника податку на додану вартість, відповідної інформації ПОКУПЦЮ. <br />У випадку, якщо внаслідок невиконання з ПРОДАВЦЕМ вказаних зобов’язань ПОКУПЦЮ завдано збитків (з вини ПРОДАВЦЯ) шляхом: збільшення податкових зобов’язань  щодо будь-якого податку; зменшення від'ємного значення об’єкту оподаткування податком; нарахування штрафів та пені, то ПРОДАВЕЦЬ зобов’язаний компенсувати такі збитки.</li>\n</ul></li>\n<li>Сторони звільняються від відповідальності за невиконання та (або) неналежне виконання своїх зобов'язань за даним Договором, якщо таке невиконання та (або) неналежне виконання сталося у випадку дії обставин непереборної сили. До обставин непереборної сили відносяться будь які обставини поза вольовим впливом Сторін, які Сторони не могли передбачити або запобігти розумними заходами. До таких обставин відносяться, але не обмежуються, зокрема: пожежі, повені, урагани, землетруси, військові дії, впровадження надзвичайного стану, акти та дії органів державної влади та місцевого самоврядування.</li>\n<li>У випадку настання обставин непереборної сили, Сторона яка знаходиться під дією даних обставин (потерпіла сторона), зобов'язана негайно сповістити іншу Сторону про зазначені обставини а також про їхній характер, тривалість й оцінку їхнього впливу на виконання зобов'язань за цим Договором. Наявність дії обставин  непереборної сили, а також їхній взаємозв'язок з неможливістю виконання зобов'язань за даним Договором повинно підтверджуватись  відповідним документом, виданим Торгово-промисловою палатою України або її регіональними представництвами, що є достатнім підтвердженням наявності дії обставин непереборної сили. Строк виконання зобов'язань за даним Договором, виконання яких було перервано дією обставин непереборної сили продовжується, відповідно до терміну дії обставин непереборної сили. Сторона яка не сповістила або несвоєчасно сповістила про настання обставин непереборної сили втрачає право посилатися на них як на підставу невиконання або неналежного виконання зобов'язань відповідно до  даного Договору.</li>\n</ol>	<ol><li>Усі спори між Сторонами щодо укладення, виконання, зміни та (або) припинення даного договору вирішуються згідно чинного законодавства. При цьому дотримання досудового порядку врегулювання спорів не є для сторін обов’язковим.</li>\n<li>Жодна із сторін не має право передавати свої права за даним договором третій стороні без письмової згоди іншої сторони.</li>\n<li>Зміни та доповнення, додаткові угоди та додатки до цього Договору є його невід’ємною частиною і мають юридичну силу у разі, якщо вони викладені у письмовій формі та підписані уповноваженими на те представниками Сторін.</li>\n<li>Усі правовідносини, що виникають у зв’язку з виконанням умов цього Договору і не врегульовані ним, регламентуються нормами чинного в Україні законодавства.</li>\n<li>Данний договір укладено Сторонами при повному розумінні його предмету та суті прав та зобов’язань що витікають з нього.</li>\n<li>Постачальник є платником податку на прибуток на загальних умовах.</li>\n<li>Покупець є платником податку на прибуток на загальних умовах.</li>\n</ol>	\N	Configuring	UPN:DMS:Contracts:Contract:1900981	\N	{}	\N	urn:Actor:User:System:1	\N	t	f	f	f	\N	\N	1456669896	1456669896	{urn:Management:Post:Individual:1118804000,urn:Management:Post:Individual:1816416714}	\N	\N	\N	\N	\N
