222287943	2059004404	47836635	1286808364	115997801	10341110	1642094893	undefined	{7639262,892151986,801787940,522115476}	{1118804000,1816416714}	\N	Александровка	2016-02-01	2	\N	40000.00	Donec ac finibus eros, ac vehicula eros. Sed vel rhoncus nunc. Nulla rhoncus semper orci sit amet eleifend. In ac felis at tellus vehicula varius. Suspendisse potenti. Maecenas quis nisi id nulla semper posuere eu at justo. Aliquam rutrum cursus finibus. Nulla at risus nec tellus iaculis tristique. Aenean sapien mi, consectetur ac elit nec, fermentum ullamcorper ex. Donec ornare aliquam vestibulum. Fusce faucibus eu erat ut pretium. Vivamus dui velit, aliquam sed feugiat ut, pretium in mauris.	{}	<p>Сторони, що мають статус платників податку на прибуток на загальних підставах, передбачених Податковим кодексом України:<br />Замовник: Товариство з обмеженою відповідальністю «ХФК «Біокон», особі Директора Павлової Віри Валеріївни, яка діє на підставі Статуту, з однієї Сторони<br />Підрядник: __________________________________________в особі______________________________, який діє на підставі __________________________, з другої Сторони далі по тексту разом - Сторони, а кожний окремо - Сторона», уклали цей Договір, далі по тексту - Договір про нижченаведене:</p>	<ol><li>Замовник доручає, а Підрядник приймає на себе зобов'язання виконати на свій ризик весь обсяг робіт по _________________________________________________________ відповідно до умов даного Договору та Технічного завдання (Додаток №1 до даного Договору), затвердженого та підписаного Сторонами.</li>\n<li>Відповідно до положень даного Договору Замовник зобов'язаний прийняти та оплатити  виконані Роботи.</li>\n<li>Підрядник має право залучати до робіт субпідрядників за умови письмового повідомлення про це Замовника, при цьому, залишаючись відповідальним на умовах Договору за виконання цими субпідрядниками робіт у такому ж ступені, як він відповідає за свої роботи.</li>\n</ol>	<ol><li>Сторони домовились, що загальна кошторисна вартість робіт (Договірна ціна) становить _________________грн. (_________________________________________грн. 00 коп.), крім того ПДВ 20% _______________________ грн. (_______________________________ грн. ____ коп.), всього ____________________________грн. (____________________________________грн. ___коп.)</li>\n<li>Дана сума включає в себе всі необхідні витрати на виконання робіт, передбачених Технічним завданням.</li>\n<li>Загальна кошторисна вартість робіт (Ціна договору) є твердою в розумінні розділу 3.3. ДБН 1.1-1-2000 «Правила визначення вартості будівництва». Тверда договірна ціна визначена з урахуванням фізичних обсягів робіт згідно Технічного завдання, та цін на ресурси, матеріали та роботи, що склалися в регіоні, згідно Переліку основних будівельних матеріалів (Додаток №2 до даного Договору) та Кошторису (Додаток №5 до даного Договору).</li>\n<li>У випадку внесення Замовником змін у погоджене та підписане Сторонами Технічне <br />завдання, договірна ціна передбачена п. 3.1. даного Договору в обов'язковому випадку переглядається, що буде оформлено у вигляді додаткової угоди до даного Договору.</li>\n</ol>	<ol><li>Авансування робіт по даному Договору Замовник здійснює згідно Графіку фінансування<br />робіт (Додаток №4 до даного Договору).</li>\n<li>Останній платіж повинен здійснюватися Замовником протягом 10 (десяти) банківських днів після підписання Акту здачі-прийому виконаних робіт і становить 50% (п’ятдесят) від вартості робіт по Договору.</li>\n</ol>	<ol><li>Виконання робіт за Договором починається з дня перерахування Замовником Підряднику першого авансового платежу відповідно до Графіку фінансування робіт (Додаток №4 до даного Договору).</li>\n<li>Тривалість робіт, виконуваних Підрядником, повинна відповідати Графіку виконання <br />робіт (Додатку №3), але в будь-якому разі всі роботи повинні бути завершені не пізніше «___» ________ 20__ року. Датою завершення робіт вважається дата підписання Акту здачі-приймання виконаних робіт Робочою комісією Замовника.</li>\n</ol>	<ol><li>Забезпечення робіт всім обсягом необхідних матеріалів, систем, приладів, механізмів, робочих інструментів у повному обсязі, а також організація всього процесу їх поставки, очищення від мит, перевірки якості й комплектності, складування, зберігання й належного використання для провадження робіт покладається на Підрядника.</li>\n<li>Всі використовувані Підрядником матеріали, кошти, прилади й устаткування повинні відповідати стандартам, установленим в Україні, підлягають обов'язковій сертифікації на території України, повинні мати сертифікати походження й сертифікати відповідності встановленим в Україні стандартам.</li>\n<li>Підрядник гарантує, що будь-які заборонені для використання, бувші у використанні, або небезпечні для здоров'я й навколишнього середовища матеріали не будуть використані для виконання робіт за Договором. У випадку виявлення Замовником таких матеріалів і встаткування на Об'єкті, Підрядник повинен буде замінити їх за свій рахунок у найкоротший термін, не звільняючись від відповідальності.</li>\n</ol>	<ol><li>Виконання робіт і відповідальність за якість і строки виконання робіт в повному обсязі покладають на Підрядника.</li>\n<li>Роботи виконуються відповідно до Графіка виконання робіт (Додаток № 3 до Договору).</li>\n<li>Представники Замовника мають право одержати доступ у будь-який час, у будь-які приміщення Об'єкта, перевіряти відповідність робіт Технічному завданню, контролювати якість виконаних робіт, у тому числі схованих; перевірити якість матеріалів і конструкцій; проводити проміжні контрольні виміри виконаних робіт і використовуваних матеріалів, перевіряти наявність сертифікатів відповідності на матеріали, конструкції й інші необхідні документи; з'ясовувати інші питання по виконанню робіт.</li>\n<li>Замовник має право в будь-який момент на свій розсуд вносити зміни щодо pобіт за Договором, збільшити або зменшити обсяги робіт, змінити послідовність етапів виконання pобіт, замінити один етап виконання pобіт іншим у разі погодження цих змін із Підрядником та оформлення їх у вигляді додаткової угоди до даного Договору. Підрядник і Замовник повинні спільно погодити підтвердження ціни стосовно додаткового обсягу робіт і оформити документально таку взаємну згоду шляхом підписання додаткової угоди до даного Договору.</li>\n<li>Підрядник зобов'язується вести всю необхідну поточну й виконавчу документацію, передбачену чинним законодавством України, й за свій рахунок дотримуватися всіх спеціальних виробничих, технічних, і інших норм і розпоряджень, з огляду на вимоги відносно:\n<ul><li>виробничої санітарії;</li>\n<li>техніки безпеки й охорони праці;</li>\n<li>охорони навколишнього середовища;</li>\n<li>збирання й вивозу будівельного сміття й очищення доріг і нести за свій рахунок всі витрати, які зможуть виникнути у зв’язку з виконанням викладеного вище положення.</li>\n</ul></li>\n</ol>	<ol><li>Гарантійний Період на роботи, виконані за даним Договором, становить 1 (один) рік. Перебіг гарантійного періоду починається з дати здачі Замовнику завершених Робіт.</li>\n<li>У разі виявлення протягом гарантійних строків у закінчених роботах недоліків (дефектів) Замовник протягом 10 (десяти) календарних днів після їх виявлення повідомить про це Підрядника і запросить його для складання акта про порядок і строки усунення виявлених недоліків (дефектів). Якщо Підрядник не з'явиться без поважних причин у, визначений у запрошенні строк, Замовник має право залучити до складання акта незалежних експертів, повідомивши про це Підрядника.<br />Акт, складений без участі Підрядника, надсилається йому для виконання протягом 10 (десяти) календарних днів після складання.</li>\n<li>Підрядник зобов'язаний за свій рахунок усунути залежні від нього недоліки (дефекти) в строки та в порядку, визначені в акті про їх усунення. Якщо Підрядник не забезпечить виконання цієї вимоги чи буде порушувати строки її виконання, Замовник має право прийняти рішення, попередньо повідомивши про нього Підрядника, про усунення недоліків (дефектів) власними силами або із залученням третіх осіб із відшкодуванням витрат та одержаних збитків за рахунок Підрядника.</li>\n</ol>	<ol><li>Підрядник зобов'язаний письмово за 5 (п'ять) календарних днів до завершення робіт повідомити Замовника про закінчення робіт і готовності до проведення випробувань і здачі робіт Робочій комісії Замовника.</li>\n<li>Замовник організовує та забезпечує створення та діяльності Робочої комісії Замовника для приймання виконаних робіт. Робоча комісія діє протягом 30 календарних днів з моменту її створення та в процесі своєї діяльності здійснює:\n<ul><li>Перевірку відповідності виконаних робіт Технічному завданню, нормативній документації і правилам виконання робіт із проведенням у необхідних випадках контрольних випробувань конструкцій;</li>\n<li>Перевірку виконавчої документації, актів проміжних перевірок і випробувань, документів які підтверджують якість використовуваних при будівництві матеріалів, акти на приховані роботи;</li>\n<li>Перевірку окремих конструкцій і вузлів;</li>\n<li>Інші випробування і перевірки, необхідні для визначення готовності робіт до гарантійної експлуатації.</li>\n</ul></li>\n<li>Після закінчення строку дії Робочої комісії, передбаченого п. 8.2. даного Договору, по результатам її діяльності Сторонами складається та підписується акт про закінчення Підрядником робіт в обсягах, передбачених даним Договором, та прийняття Замовником робіт.<br />8.4.У випадку виявлення Робочою комісією недоробок чи дефектів у роботах Підрядника, які сталися з його вини, складається акт із переліком таких недоробок чи дефектів, які Підрядник зобов'язується усунути в найкоротші строки (протягом строку дії Робочої комісії).</li>\n</ol>	<ol><li>Підрядник несе відповідальність за порушення зі своєї вини таких зобов'язань за Договором і у таких сумах:<br />за порушення строків закінчення виконання робіт сплачує неустойку в розмірі 20 відсотків річних від договірної ціни робіт;<br /> у разі виявлення недоліків (дефектів) у роботах сплачує штраф у розмірі 20 відсотків від вартості робіт, виконаних з недоліками (дефектами).<br /> у разі порушення строків усунення недоліків (дефектів), виявлених Замовником, контролюючими органами, визначених в акті усунення недоліків протягом гарантійного строку сплачує штраф у сумі 1000 грн. (одну тисячу грн.) за кожний день затримки.<br />Крім сплати штрафних санкцій Підрядник компенсує Замовнику збитки, зумовлені невиконанням або неналежним виконанням своїх зобов'язань за Договором.</li>\n<li>Сторони зобов'язуються докладати зусиль для вирішення спорів у досудовому порядку, в тому числі шляхом проведення переговорів, пошуку взаємоприйнятних рішень, залучення експертів, продовження строків врегулювання розбіжностей, внесення змін в умови Договору тощо.<br /> У разі вирішення спорів у судовому порядку Сторони будуть звертатися до суду за місцем знаходження відповідача.</li>\n</ol><p> </p>	<ol><li>Зміна Договору здійснюється шляхом зміни або доповнення його умов за ініціативою будь-якої Сторони на підставі додаткової угоди. Додаткова угода є невід'ємною частиною Договору.</li>\n<li>Замовник має право розірвати Договір, надіславши повідомлення Підряднику, у разі:<br />прийняття рішення про припинення виконання робіт;<br />прийняття судом постанови про визнання Підрядника банкрутом. <br />якщо Підрядник за своєї вини: не розпочав виконання робіт протягом 3 (трьох) робочих днів з дня, коли він повинен згідно з Договором розпочати їх виконання;<br />допустив відставання темпів виконання робіт від передбачених графіком на 3 (три) робочі дні;<br />виконав роботи з істотними недоліками і не забезпечив їх усунення у визначений Замовником строк;<br />допустив недоліки (дефекти), які виключають можливість використання об'єкта для вказаної в Договорі мети та не можуть бути усунені Підрядником.</li>\n<li>У разі якщо рішення про розірвання Договору приймається відповідно до умов пункту п.10.2., Договір вважається розірваним з дня одержання Підрядником повідомлення про таке рішення.</li>\n<li>У разі розірвання Договору в зв'язку з припиненням виконання робіт за ініціативою Замовника, Замовник оплатить Підряднику роботи, виконані на момент розірвання Договору.</li>\n<li>У разі розірвання Договору в зв'язку з оголошенням Підрядника банкрутом та за іншими обставинами, визначеними в п. 10.2. Договору, Підрядник протягом 5 (п’яти) робочих днів після отримання відповідного повідомлення за актом передасть Замовнику виконані роботи, поверне Замовнику суму невикористаного авансу та відшкодує Замовнику його витрати та збитки, зумовлені розірванням Договору, сплатить пред'явлені штрафні санкції за порушення договірних зобов'язань.</li>\n</ol>	<ol><li>Цей Договір вважається укладеним і набирає чинності з моменту його підписання Сторонами та скріплення печатками Сторін.<br />Строком Договору є час, протягом якого Сторони будуть здійснювати свої права та виконувати свої обов'язки відповідно до Договору.</li>\n<li>Закінчення строку Договору не звільняє Сторони від відповідальності за його порушення, яке мало місце під час дії Договору.</li>\n</ol>	<ol><li>Сторони звільняються від відповідальності за часткове або повне невиконання зобов'язань цим Договором, якщо дане невиконання з'явилося наслідком надзвичайних і невідворотних подій, що не залежать від волі сторін, що виникли після набрання чинності даного Договору, і які не можна було передбачати в момент його висновку, а саме: повеней, землетрусів, пожежі, інші стихійних лих, епідемій, війни, воєнних дій, змін чинного законодавства, технологічні фактори, а також будь-яких інших обставин поза розумним контролем сторін, якщо ці обставини безпосередньо вплинули на виконання даного Договору, навмисні шкідливі дії третіх осіб, направлені на припинення або призупинення робіт Підрядником.</li>\n<li>Сторона, що не може виконати свої зобов'язання в силу таких обставин, зобов'язана<br />після виникнення й припинення вищевказаних обставин негайно, не пізніше 10 (десяти) діб з моменту їхнього початку й припинення письмово повідомити про це іншу сторону. Несвоєчасне попередження про обставини непереборної сили позбавляє відповідну сторону права посилатися на них у майбутньому.</li>\n<li>Належним доказом наявності, зазначених вище обставин і їхньої тривалості, будуть служити документи, видавані Торгово-промисловою палатою України.</li>\n<li>У випадках, передбачених у п. 12.1. даного Договору, строк виконання стороною зобов'язань за цим Договором відсувається відповідно до часу, протягом якого діють такі обставини і їхні наслідки.</li>\n<li>Якщо ці обставини будуть тривати більше 6 (шести) місяців або, якщо при наставанні даних обставин стає ясним, що вони і їхні наслідки будуть діяти більше цього строку, сторони, у можливо більш короткий строк, зобов'язуються провести переговори з метою виявлення прийнятних для них альтернативних способів виконання даного Договору й досягнення відповідної домовленості.</li>\n</ol>	<ol><li>Будь-які зміни та доповнення Договору та інших договірних документів вважаються дійсними, якщо вони оформлені в письмовій формі та підписані (узгоджені) Сторонами.</li>\n<li>Договір укладено у 2 (двох) примірниках по одному для кожної Сторони.</li>\n</ol>	<ol><li>Додаток №1 Технічне завдання на виконання робіт</li>\n<li>Додаток №2 Перелік основних матеріалів.</li>\n<li>Додаток №3 Графік виконання робіт.</li>\n<li>Додаток №4 Графік фінансування.</li>\n<li>Додаток №5 Кошторисна документація (локальні кошториси, договірна ціна)</li>\n</ol>	\N	Configuring	UPN:DMS:Contracts:Contract:6923212	\N	{}	\N	urn:Actor:User:System:1	\N	t	f	f	f	\N	\N	1456669933	1456669933	{urn:Management:Post:Individual:1118804000,urn:Management:Post:Individual:1816416714}	\N	\N	\N	\N	\N
